import { Text, View, Image, Button } from 'react-native'
import React, { Component } from 'react'

export class Landing extends Component {
  render() {
    return (
      <View
        style={{ 
            marginTop: 120,
        }}
      >
        <View
             style={{ 
                flex: 1,
                justifyContent: "center",
                alignItems: "center"
            }}
        >
        <Image
              resizeMode="contain"
              style={{
                height: 250,
                width: 290,
              }}
              source={require("../../../assets/splash.png")}
            />
        <View
            style={{ 
                flex: 1,
                justifyContent: "center",
                alignItems: "center",
                marginTop: 200
            }}
        >
        <Button 
            title="Press me"
            color="#f194ff"

        />
            
        </View>
        </View>
      </View>
    )
  }
}

export default Landing
